inline const char8* enumToString(DmiSystemPowerSupplyInputVoltageRangeSwitch rangeSwitch) // TEST: NO                                                                                                    // Colorize: green
{                                                                                                                                                                                                        // Colorize: green
    // COMMON_LT((" | rangeSwitch = %u", rangeSwitch)); // Commented to avoid bad looking logs                                                                                                           // Colorize: green
                                                                                                                                                                                                         // Colorize: green
                                                                                                                                                                                                         // Colorize: green
                                                                                                                                                                                                         // Colorize: green
    switch (rangeSwitch)                                                                                                                                                                                 // Colorize: green
    {                                                                                                                                                                                                    // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::NONE:           return "NONE";                                                                                                                 // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::OTHER:          return "OTHER";                                                                                                                // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::UNKNOWN:        return "UNKNOWN";                                                                                                              // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::MANUAL:         return "MANUAL";                                                                                                               // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::AUTO_SWITCH:    return "AUTO_SWITCH";                                                                                                          // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::WIDE_RANGE:     return "WIDE_RANGE";                                                                                                           // Colorize: green
        case DmiSystemPowerSupplyInputVoltageRangeSwitch::NOT_APPLICABLE: return "NOT_APPLICABLE";                                                                                                       // Colorize: green
                                                                                                                                                                                                         // Colorize: green
        default: return "UNKNOWN";                                                                                                                                                                       // Colorize: green
    }                                                                                                                                                                                                    // Colorize: green
}                                                                                                                                                                                                        // Colorize: green
                                                                                                                                                                                                         // Colorize: green
