inline const char8* enumToFullString(DmiSystemPowerSupplyInputVoltageRangeSwitch rangeSwitch) // TEST: NO                                                                                                // Colorize: green
{                                                                                                                                                                                                        // Colorize: green
    // COMMON_LT((" | rangeSwitch = %u", rangeSwitch)); // Commented to avoid bad looking logs                                                                                                           // Colorize: green
                                                                                                                                                                                                         // Colorize: green
                                                                                                                                                                                                         // Colorize: green
                                                                                                                                                                                                         // Colorize: green
    static char8 res[24];                                                                                                                                                                                // Colorize: green
                                                                                                                                                                                                         // Colorize: green
    sprintf(res, "0x%04X (%s)", (u8)rangeSwitch, enumToString(rangeSwitch));                                                                                                                             // Colorize: green
                                                                                                                                                                                                         // Colorize: green
    return res;                                                                                                                                                                                          // Colorize: green
}                                                                                                                                                                                                        // Colorize: green
